  const handleChange = (event) => {
    setChecked(event.target.checked);
    console.log('evernt', event);
  };

  render() {
    return (
          <Checkbox
            label={this.props.category}
            iconStyle={{fill: '#000'}}
            value={this.props.category}
            onCheck={this.handleChange}
          />
    )}
}

